    body:
      string: '{"custom_id":"2","result":{"type":"succeeded","message":{"id":"msg_01VJoMXF5UN3pyDdVz9hcwYs","type":"message","role":"assistant","model":"claude-3-5-sonnet-20241022","content":[{"type":"text","text":"Ramen
        is a popular Japanese noodle dish that consists of Chinese-style wheat noodles
        served in a meat or fish-based broth, often flavored with soy sauce or miso.
        Here are some key aspects of ramen:\n\nCommon components:\n1. Noodles (usually
        wheat-based)\n2. Broth (can be shoyu, miso, shio, or tonkotsu)\n3. Toppings,
        such as:\n- Chashu (braised pork)\n- Nori (dried seaweed)\n- Menma (fermented
        bamboo shoots)\n- Soft-boiled egg\n- Green onions\n- Bean sprouts\n- Corn\n-
        Narutomaki (fish cake)\n\nPopular styles:\n1. Shoyu (soy sauce-based)\n2.
        Miso (fermented soybean paste-based)\n3. Shio (salt-based)\n4. Tonkotsu (pork
        bone broth)\n\nRegional variations:\n- Sapporo (miso ramen)\n- Hakata (tonkotsu
        ramen)\n- Tokyo (shoyu ramen)\n- Kitakata (light shoyu ramen)\n\nRamen can
